Coast: Series 7

Travel Documentary hosted by Nick Crane, published by BBC in 2012 - English narration


Information
------------------------------

Coast: Series 7 
COAST explores the edge of our lives, the coastline that marries us to the sea. It takes in the life of that coastline, the people who live there, the history played out upon it and the sea itself, a tempestuous and unpredictable bride that also brings food and comfort to those who visit its shores. Nick Crane is joined by a fascinated and fascinating team of expert presenters including Neil Oliver, Miranda Krestovnikoff, Mark Horton, Tessa Dunlop, Dick Strawbridge, Andy Torbet, Hermione Cockburn, Ian McMillan and Ruth Goodman as they discover the rich landscapes and lifestyles that appear along our shores




3)  The Hidden History of Harbours 
Exploring the history of Britain's harbours. Nicholas Crane visits Newlyn, Cornwall, where in 1854, a fishing boat set sail on the 12,000-mile journey to Melbourne, Australia. Dick Strawbridge explores the building of airships in Barrow-in-Furness, Cumbria, in the early 1900s, while Tessa Dunlop travels to Portsmouth to investigate the history of body art. Ruth Goodman hears how Birkenhead's harbour led to the opening of the world's first municipal park and there is a look at naval warfare re-enactments by Scarborough council staff.



